import styles from "./customClock.module.css"
import { useState, useEffect, useRef } from "react";

function beep() {
    var snd = new Audio("data:audio/mpeg;base64,")
    snd.play();
}

function sleep(ms) {
    return new Promise(resolve => setTimeout(resolve, ms));
}

async function mutipleBeep(times) {
    for (let i = 0; i < times; i++) {
        beep();
        await sleep(600);
    }
}


function CustomClock(props){
    const [minutes, setMinutes] = useState(0);
    const [seconds, setSeconds] = useState(0);
    const [centiSeconds, setCentiSeconds] = useState(0);
    const [pause,setPause] = useState(true);
    const [startTime,setStartTime] = useState(0);
    const [CurrTime,setCurrTime] = useState(0);
    const [timer,setTimer] = useState(true);
    const clockRef = useRef(null);

    useEffect(() => {
        if(clockRef.current)
            clockRef.current.innerHTML = `${String(minutes).padStart(2, '0')}:${String(seconds).padStart(2, '0')}:${String(centiSeconds).padStart(2, '0')}`
    }, [centiSeconds]);

    useEffect(() => {
        if (minutes == 0 && seconds == 0 && centiSeconds == 0)
            return;
        let currSecond = seconds + minutes * 60
        if (props.soundOn && currSecond % props.interval == 0)
            beep();
    }, [seconds]);

    function updateTime(){ 
        if (pause){
            let localStartTime = startTime
            console.log(startTime)
            if (startTime == 0)
                setStartTime(Date.now())
                localStartTime = Date.now()

            setTimer(setInterval(() => {
                const currentElapsed = Date.now() - localStartTime + CurrTime; 
                const newCentiSeconds = Math.floor(currentElapsed / 10) % 100; 
                const newSeconds = Math.floor(currentElapsed / 1000) % 60; 
                const newMinutes = Math.floor(currentElapsed / 60000); 

                setCurrTime(currentElapsed);
                setCentiSeconds(newCentiSeconds);
                setSeconds(newSeconds);
                setMinutes(newMinutes);
            }, 10));
        }else{
            clearInterval(timer);
        }
        setPause(!pause)
    };

    return (
        <div ref={clockRef} onClick={() => updateTime()} className={styles.clock}>00:00:00</div>
    );
}

export default CustomClock